import React from 'react'
import {Link} from 'react-router-dom'

const SelectExistingCharacterButton = () => {
    return(
        <h2 id="new-character-button" className="button"><Link>Select Existing Character...</Link></h2>
    )
} 

export default SelectExistingCharacterButton
